using Amazon.CDK.AWS.AutoScaling;
using Amazon.CDK.AWS.CloudWatch;

ServerApplication application;
AutoScalingGroup asg;
Alarm alarm;

ServerDeploymentGroup deploymentGroup = new ServerDeploymentGroup(this, "CodeDeployDeploymentGroup", new ServerDeploymentGroupProps {
    Application = application,
    DeploymentGroupName = "MyDeploymentGroup",
    AutoScalingGroups = new [] { asg },
    // adds User Data that installs the CodeDeploy agent on your auto-scaling groups hosts
    // default: true
    InstallAgent = true,
    // adds EC2 instances matching tags
    Ec2InstanceTags = new InstanceTagSet(new Dictionary<string, string[]> {
        // any instance with tags satisfying
        // key1=v1 or key1=v2 or key2 (any value) or value v3 (any key)
        // will match this group
        { "key1", new [] { "v1", "v2" } },
        { "key2", new [] {  } },
        { "", new [] { "v3" } }
    }),
    // adds on-premise instances matching tags
    OnPremiseInstanceTags = new InstanceTagSet(new Dictionary<string, string[]> {
        { "key1", new [] { "v1", "v2" } }
    }, new Dictionary<string, string[]> {
        { "key2", new [] { "v3" } }
    }),
    // CloudWatch alarms
    Alarms = new [] { alarm },
    // whether to ignore failure to fetch the status of alarms from CloudWatch
    // default: false
    IgnorePollAlarmsFailure = false,
    // auto-rollback configuration
    AutoRollback = new AutoRollbackConfig {
        FailedDeployment = true,  // default: true
        StoppedDeployment = true,  // default: false
        DeploymentInAlarm = true
    }
});

java.source:
import software.amazon.awscdk.services.autoscaling.*;
import software.amazon.awscdk.services.cloudwatch.*;

ServerApplication application;
AutoScalingGroup asg;
Alarm alarm;

ServerDeploymentGroup deploymentGroup = ServerDeploymentGroup.Builder.create(this, "CodeDeployDeploymentGroup")
        .application(application)
        .deploymentGroupName("MyDeploymentGroup")
        .autoScalingGroups(List.of(asg))
        // adds User Data that installs the CodeDeploy agent on your auto-scaling groups hosts
        // default: true
        .installAgent(true)
        // adds EC2 instances matching tags
        .ec2InstanceTags(new InstanceTagSet(Map.of(
                // any instance with tags satisfying
                // key1=v1 or key1=v2 or key2 (any value) or value v3 (any key)
                // will match this group
                "key1", List.of("v1", "v2"),
                "key2", List.of(),
                "", List.of("v3"))))
        // adds on-premise instances matching tags
        .onPremiseInstanceTags(new InstanceTagSet(Map.of(
                "key1", List.of("v1", "v2")), Map.of(
                "key2", List.of("v3"))))
        // CloudWatch alarms
        .alarms(List.of(alarm))
        // whether to ignore failure to fetch the status of alarms from CloudWatch
        // default: false
        .ignorePollAlarmsFailure(false)
        // auto-rollback configuration
        .autoRollback(AutoRollbackConfig.builder()
                .failedDeployment(true) // default: true
                .stoppedDeployment(true) // default: false
                .deploymentInAlarm(true)
                .build())
        .build();

